import React from "react"
import {Link} from "react-router-dom"
import "./NavBar.css"
import logo from './lendelogoblack.png';

function Navbar() {

    let pages = [
        {url: '/finditems', name: 'Find items'},
        {url:'/login', name: 'Sign Up/Log In'}]
    let data = [
        {
            key: 'j',
            value: 'John Doe',
        },
        {
            key: 'j',
            value: 'Jane Doe',
        },
        {
            key: 'm',
            value: 'Mary Phillips',
        },
        {
            key: 'r',
            value: 'Robert',
        },
        {
            key: 'k',
            value: 'Karius',
        },
    ]
    return (
        <div>
            <Link to={'/main'} className='logo' key={'Momento'}>
                <img src={logo} className='logo' alt={'lende logo'} />
            </Link>
            <div className='navbar'>
                {pages.map((items) =>
                    <Link to={items.url} className='link' key={items.name}>
                        {items.name}
                    </Link>
                )}
            </div>
        </div>


    );
}



export default Navbar;
